import React, { useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { analyzeWebsite } from './store/websiteSlice';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend } from 'recharts';
import { ArrowRight, Globe, Users, Target } from 'lucide-react';

const VisitorClassifier = () => {
  const [url, setUrl] = useState('');
  const dispatch = useDispatch();
  const { result, loading, error, stats } = useSelector((state) => state.website);
  const [selectedOption, setSelectedOption] = useState(null);

  const handleSubmit = (e) => {
    e.preventDefault();
    dispatch(analyzeWebsite(url));
  };

  const handleOptionSelect = (index) => {
    setSelectedOption(index);
  };

  return (
    <div className="min-h-screen bg-gray-50 p-6">
      <div className="max-w-6xl mx-auto">
        {/* Header Section */}
        <div className="mb-8 text-center">
          <h1 className="text-3xl font-bold text-gray-800 mb-2">
            Website Visitor Classifier
          </h1>
          <p className="text-gray-600">
            Analyze website content and classify visitor interests
          </p>
        </div>

        {/* Input Section */}
        <div className="bg-white rounded-lg shadow-md p-6 mb-6">
          <form onSubmit={handleSubmit} className="flex gap-4">
            <div className="flex-1">
              <input
                type="url"
                placeholder="Enter website URL (e.g., apple.com)"
                value={url}
                onChange={(e) => setUrl(e.target.value)}
                required
                className="w-full px-4 py-2 border rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
              />
            </div>
            <button
              type="submit"
              disabled={loading}
              className="bg-blue-600 text-white px-6 py-2 rounded-lg hover:bg-blue-700 transition duration-300 flex items-center gap-2"
            >
              {loading ? (
                'Analyzing...'
              ) : (
                <>
                  Analyze <ArrowRight size={20} />
                </>
              )}
            </button>
          </form>
        </div>

        {error && (
          <div className="bg-red-50 border-l-4 border-red-500 p-4 mb-6">
            <p className="text-red-700">{error}</p>
          </div>
        )}

        {result && (
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            {/* Question Card */}
            <div className="bg-white rounded-lg shadow-md p-6">
              <h2 className="text-xl font-semibold mb-4">{result.question}</h2>
              <div className="space-y-3">
                {result.options.map((option, index) => (
                  <div
                    key={index}
                    onClick={() => handleOptionSelect(index)}
                    className={`p-4 border rounded-lg cursor-pointer transition duration-300 ${
                      selectedOption === index
                        ? 'bg-blue-50 border-blue-500'
                        : 'hover:bg-gray-50'
                    }`}
                  >
                    <p className="font-medium">{option}</p>
                  </div>
                ))}
              </div>
            </div>

            {/* Insights Card */}
            <div className="bg-white rounded-lg shadow-md p-6">
              <h2 className="text-xl font-semibold mb-4">Content Insights</h2>
              <div className="space-y-4">
                <div className="flex items-center gap-3">
                  <Globe className="text-blue-500" />
                  <div>
                    <p className="font-medium">Primary Focus</p>
                    <p className="text-gray-600">{result.primaryFocus}</p>
                  </div>
                </div>
                <div className="flex items-center gap-3">
                  <Users className="text-green-500" />
                  <div>
                    <p className="font-medium">Target Audience</p>
                    <p className="text-gray-600">{result.targetAudience}</p>
                  </div>
                </div>
                <div className="flex items-center gap-3">
                  <Target className="text-purple-500" />
                  <div>
                    <p className="font-medium">Content Type</p>
                    <p className="text-gray-600">{result.contentType}</p>
                  </div>
                </div>
              </div>
            </div>

            {/* Analytics Chart */}
            <div className="md:col-span-2 bg-white rounded-lg shadow-md p-6">
              <h2 className="text-xl font-semibold mb-4">Topic Distribution</h2>
              <div className="h-64">
                <LineChart
                  width={800}
                  height={250}
                  data={result.topicDistribution}
                  margin={{ top: 5, right: 30, left: 20, bottom: 5 }}
                >
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="name" />
                  <YAxis />
                  <Tooltip />
                  <Legend />
                  <Line
                    type="monotone"
                    dataKey="value"
                    stroke="#8884d8"
                    activeDot={{ r: 8 }}
                  />
                </LineChart>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default VisitorClassifier;
